window.bookSummaryJSON = "<p>Ruby James has finally made it. As an official Rater, she's reached upper class society and all that comes with it - a huge house in a guarded neighborhood, box seats, and an elite client list. She even has the perfect boyfriend to go with it, one she expects to marry as soon as her career settles. </p> <p>Then she uncovers a terrible secret. One her boss will do anything to protect. </p> <p>Now Ruby must decide how much her dreams truly mean to her. Can she remain silent and keep everything she's worked for, or does she dare risk it all to fight for justice? </p> <p>This is the companion story to <i>Numbers Ignite</i>, book two of the best-selling and award-winning Numbers Game saga. However, as a prequel, it can be listened to at any point in the series. </p> <p><b>Disclaimer</b>: While PG-rated, this book may be a trigger for victims of sexual assault. </p>"; 
